Okay, let's think this through. The ultimatum game involves decisions about fairness and potential rejection of unfair offers. Key psychological factors are likely to include:

1.  **Fairness Perception:** People have an idea of what constitutes a fair split, which can be influenced by relative contributions (token\_self vs. token\_opp) and the total amount to be divided (combined\_earning).
2.  **Inequity Aversion:** People dislike unequal outcomes, both when they are disadvantaged (receiving less than the opponent) and sometimes when they are advantaged (receiving more than the opponent).
3.  **Offer Value Sensitivity:** The absolute amount offered to the responder matters. A small unfair offer might be rejected, while a larger unfair offer might be accepted simply because it's a substantial amount of money.
4.  **Loss Aversion:** People feel the pain of a loss (rejecting an offer) more strongly than the pleasure of an equivalent gain.
5.  **Contribution influence:** The degree to which a person's own contribution to the "pot" affects the minimum amount they will accept.
6. **Noise/Consistency:** There is going to be variability in people's choices, and some people may be more consistent than others.

These factors interact in complex ways. For example, fairness perception and inequity aversion can be modulated by the offer value. Someone might be willing to accept a slightly unfair offer if the absolute amount received is high enough. Loss aversion can strengthen the tendency to reject unfair offers.

A possible mathematical form could be a utility function that incorporates these factors. We can model utility as a function of the offered amount, the perceived fairness, and the individual's sensitivity to inequity.

Let's define the variables:
* `split_opp`: Amount offered to the opponent
* `split_self`: Amount offered to the participant
* `combined_earning`: Total amount to be split
* `token_self`: Tokens found by participant
* `token_opp`: Tokens found by opponent

We can define a fairness measure as a function of the token contributions. A simple measure would be `fairness = token_self / (token_self + token_opp)`. This represents the proportion of tokens found by the participant. This proportion can be mulitplied by the `combined_earning` to get the total amount.

The utility will be affected by the difference between `split_self` and the fairness estimate of the earnings. We can then subtract a penalty dependent on the perceived unfairness.

Parameters needed:
* `alpha`: Sensitivity to advantageous inequity (receiving more than fair)
* `beta`: Sensitivity to disadvantageous inequity (receiving less than fair)
* `gamma`: weighting of fairness vs absolute earning
* `delta`: noise parameter

